import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom';

export default function Chat() {
    const navigate = useNavigate();
    useEffect(() => {
        if (!localStorage.getItem('chat-app-user')) {
          navigate('/login');
        }
      }, []);
  return (
    <div className='bg-[#2e1d45]'>
        <div className='bg-[#2e1d45]'>
            Hello
        </div>
    </div>
  )
}
